@jdwtweet @Telegraph Imagine working in the marketing dept. At Spoons HQ, Watford.

"Ah, another fine day of promoting burger deals! Wait, what's this...ANOTHER memo from Tim?!"
'Miss Brennan, I'd like you to send this on the Tweeter, if you wouldn't mind...VISCOUNT ROTHERMERE SAID IN 2008 THAT...'
